        private void InitTable(int col, int row)
        {
            pause();
            
            this.tableRow = row;
            this.tableLayoutPanel1.RowCount = row;
            for (int i = 0; i < row; i++)
            {
                this.tableLayoutPanel1.RowStyles.Add(new System.Windows.Forms.RowStyle(System.Windows.Forms.SizeType.Percent, 50F));
            }

            this.tableCol = col;
            this.tableLayoutPanel1.ColumnCount = col;
            for (int i = 0; i < col; i++)
            {
                this.tableLayoutPanel1.ColumnStyles.Add(new System.Windows.Forms.ColumnStyle(System.Windows.Forms.SizeType.Percent, 50F));
            }



            int cellwidth = this.tableLayoutPanel1.Width / col;
            int cellheight = this.tableLayoutPanel1.Height / row;

            for (int i = 0; i < row; i++)
            {
                for(int j = 0; j < col; j++)
                {
                    tableLayoutPanel1.Controls.Add(new Panel {Margin = new Padding(0), Size = new Size(cellwidth, cellheight)}, j, i);
                    this.tableLayoutPanel1.GetControlFromPosition(j, i).BackColor = Color.White;
                }
            }

            resume();
        }

