        private void UserInterface_Resize(object sender, System.EventArgs e)
        {
            pause();

            this.splitContainer1.Size = new System.Drawing.Size(this.Width, this.Height);
            this.splitContainer1.SplitterDistance = this.Width / 3;
            this.panel1.Size = new System.Drawing.Size(this.splitContainer1.SplitterDistance - 40, this.splitContainer1.Height - 80);
            this.panel1.Location = new System.Drawing.Point(20, 20);

            this.panel2.Size = new System.Drawing.Size(this.splitContainer1.Width - this.splitContainer1.SplitterDistance - 40, this.splitContainer1.Height - 80);
            this.panel2.Location = new System.Drawing.Point(20, 20);

            this.tableLayoutPanel1.Width = this.splitContainer1.Panel2.Width - 120;
            this.tableLayoutPanel1.Height = this.splitContainer1.Height - 400;
            this.tableLayoutPanel1.Location = new System.Drawing.Point(60, 100);

            if (tableCol != 0 && tableRow != 0)
            {
                int cellwidth = this.tableLayoutPanel1.Width / tableCol;
                int cellheight = this.tableLayoutPanel1.Height / tableRow;

                for (int i = 0; i < tableRow; i++)
                {
                    for (int j = 0; j < tableCol; j++)
                    {
                        tableLayoutPanel1.GetControlFromPosition(i, j).Size = new Size(cellwidth, cellheight);
                    }
                }
            }

            resume();
        }


